import React,{ useEffect, useState } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [todolist, settodo] = useState('')
  useEffect( () => {
    axios.get('/todos')
      .then(res => {
        console.log(res)
        settodo(res.data)
      })
      .catch(err => {
        console.log(err)
      })

  },[])
  return (
    <div className="App">
        {

          todolist.map(data => (<p> data.title </p>))
        }
    </div>
  );
}

export default App;
